// Color palette (must match the converter)
const asciiColors = [
    '#000000', '#ffffff', '#ff0000', '#00ff00', '#0000ff', '#ffff00', '#ff00ff', '#00ffff',
    '#ff8000', '#8000ff', '#00ff80', '#ff0080', '#8080ff', '#ff8080', '#80ff80', '#808080'
];

// Character dimensions
const charWidth = 6;
const charHeight = 10;

/**
 * Display ASCII art on a canvas element
 * @param {string} canvasId - ID of the canvas element
 * @param {object} asciiData - ASCII art data object with structure:
 *   {
 *     dimensions: { width: number, height: number },
 *     chars: string (all characters in one line),
 *     colorIndices: string (comma-separated color indices)
 *   }
 */
function displayAsciiArt(canvasId, asciiData) {
    const canvas = document.getElementById(canvasId);
    if (!canvas) {
        console.error(`Canvas with id '${canvasId}' not found`);
        return;
    }

    // Parse the data
    const width = asciiData.dimensions.width;
    const height = asciiData.dimensions.height;
    const chars = asciiData.chars.split('');
    const colorIndices = asciiData.colorIndices.split(',').map(Number);

    // Set canvas size
    canvas.width = width * charWidth;
    canvas.height = height * charHeight;

    const ctx = canvas.getContext('2d');

    // Clear canvas
    ctx.fillStyle = '#000000';
    ctx.fillRect(0, 0, canvas.width, canvas.height);

    // Set font
    ctx.font = '10px "Courier New", monospace';
    ctx.textBaseline = 'top';

    // Draw each character
    for (let y = 0; y < height; y++) {
        for (let x = 0; x < width; x++) {
            const idx = y * width + x;
            const char = chars[idx];
            const colorIndex = colorIndices[idx];

            ctx.fillStyle = asciiColors[colorIndex];
            ctx.fillText(char, x * charWidth, y * charHeight);
        }
    }
}

