// ============================================
function loadAndDisplayAsciiArt(canvasId, jsonUrl) {
    fetch(jsonUrl)
        .then(response => response.json())
        .then(data => {
            displayAsciiArt(canvasId, data);
        })
        .catch(error => {
            console.error('Error loading ASCII art:', error);
        });
}

// Example: loadAndDisplayAsciiArt('asciiArtCanvas', 'path/to/your-ascii-art.json');